        html,
        body {
            height: 100%;
            margin: 0;
            font-family: 'CarnasW03', sans-serif;
            background-color: #f3f3f3;
        }

        h1,
        h2,
        h3,
        h4,
        h5,
        h6 {
            margin: 0
        }

        .img-icon {
            max-width: 100%;
            width: 10rem;
            height: auto;
        }

        .header {
            display: flex
        }

        .container {
            padding: 33px 30px;
        }

        .table {
            width: 100%;
            padding-top: 3rem;
        }

        .title {
            display: grid;
            padding-left: 2rem;
            align-self: center;
        }

        table {
            border-collapse: collapse;
            background: #ffffff;
            overflow: hidden;
            width: 100%;
            margin: 0 auto;
            position: relative
        }

            table * {
                position: relative
            }

            table td,
            table th {
                padding-left: 8px;
                text-align: left;
            }

            table thead tr,
            table tfoot tr {
                height: 3.5rem;
                background: #000000;
                color: #fff;
                line-height: 1.2;
                font-weight: unset;
            }

            table tbody tr {
                height: 3.5rem;
                font-size: 15px;
                color: gray;
                line-height: 1.2;
                font-weight: unset
            }

        tbody tr:nth-child(even) {
            background-color: #e2e2e2
        }

        .col-1 {
            width: 30%;
            padding-left: 40px;
        }

        .col-2 {
            width: 30%;
        }

        .col-3,
        .col-4,
        .col-5,
        .col-6 {
            width: 10%;
            text-align: left;
        }

        .col-6 {
            padding-right: 62px;
        }

        tfoot .col-1 {
            padding-left: 40px
        }

        tfoot .col-2 {
            text-align: right;
            padding-right: 62px
        }
    </style>
